import React from 'react';
import './Banner.css';
import product1 from './productsimages/Rectangle 3.png';

const ProductCard = () => {
  return (
    <div className='productCart'>
      <div className="product">
        <img src={product1} alt="Product Image" className="product-image" />
        <div className="product-details">
          <h2 className="product-title">Men Henley Neck
            Full Sleeve Red Wine</h2>
          <p className="discount-price">₹399
          <span className="original-price">₹1299</span></p>

          <div className='productsize'>
                div
          </div>
        </div>
      </div>
    </div>
  );
}

export default ProductCard;
